    "horicon-national-wildlife-refuge-narrative-report-may-june-july-august-1942",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1942.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses plantings and wildfires. Resource management is
    outlined; topics include grazing and haying. The public relations section of the
    report describes recreational uses, Refuge visitors, and fishing. N-R forms are
